import React from 'react';
import Image from 'react-image-resizer';

const Header = () => {
	return (
		<Image
			src={require('../images/Blank_World_Banner.jpg')}
			alt="banner"
			height="5em"
			className="Banner"
		/>
	);
};

export default Header;
